//didi.github.io/mand-mobile/examples/#/chart"},o=t.body="<p>Chart made with SVG, supports polylines printing and display specification setting.</p>\n<h3 id=\"Import\">Import<a href=\"javascript:jumpAnchor('Import')\" class=\"mfe-blog-toc-item mfe-blog-toc-item-h3\">#</a></h3><pre><code class=\"lang-javascript\"><span class=\"hljs-keyword\">import</span> { Chart } <span class=\"hljs-keyword\">from</span> <span class=\"hljs-string\">'mand-mobile'</span>\n\nVue.component(Chart.name, Chart)\n</code></pre>\n<h3 id=\"Code Examples\">Code Examples<a href=\"javascript:jumpAnchor('Code Examples')\" class=\"mfe-blog-toc-item mfe-blog-toc-item-h3\">#</a></h3><!-- DEMO -->\n<h3 id=\"API\">API<a href=\"javascript:jumpAnchor('API')\" class=\"mfe-blog-toc-item mfe-blog-toc-item-h3\">#</a></h3><h4 id=\"Chart Props\">Chart Props<a href=\"javascript:jumpAnchor('Chart Props')\" class=\"mfe-blog-toc-item mfe-blog-toc-item-h4\">#</a></h4><table>\n<thead>\n<tr>\n<th>Props</th>\n<th>Description</th>\n<th>Type</th>\n<th>Default</th>\n<th>Required</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>size</td>\n<td>size of chart, the value can be a string or number with unit (px)</td>\n<td>Array</td>\n<td><code>[480, 320]</code></td>\n<td>-</td>\n</tr>\n<tr>\n<td>max</td>\n<td>maximum in Y-axis</td>\n<td>Number</td>\n<td>Leave it as blank to automatically calculate the maximum in the dataset</td>\n<td>-</td>\n</tr>\n<tr>\n<td>min</td>\n<td>minimum in Y-axis</td>\n<td>number</td>\n<td>Leave it as blank to automatically calculate the minimum in the dataset</td>\n<td>-</td>\n</tr>\n<tr>\n<td>lines</td>\n<td>the number of lines in y-axis</td>\n<td>Number</td>\n<td><code>5</code></td>\n<td>-</td>\n</tr>\n<tr>\n<td>step</td>\n<td>decreasing step in Y-axis</td>\n<td>Number</td>\n<td>Leave it as blank to automatically compute the avarage based on <code>lines</code>,<code>max</code> and <code>min</code></td>\n<td>-</td>\n</tr>\n<tr>\n<td>format</td>\n<td>labels formatting function in Y-axis</td>\n<td>Function</td>\n<td><code>val =&gt; val</code></td>\n<td>-</td>\n</tr>\n<tr>\n<td>labels</td>\n<td>labels of X-axis</td>\n<td>Array</td>\n<td>-</td>\n<td>required</td>\n</tr>\n<tr>\n<td>datasets</td>\n<td>data, the format is shown as follows</td>\n<td>Array</td>\n<td>-</td>\n<td>required</td>\n</tr>\n<tr>\n<td>shift</td>\n<td>shift in Y-axis</td>\n<td>Number</td>\n<td>0.6</td>\n<td>-</td>\n</tr>\n</tbody>\n</table>\n<h4 id=\"<code>datasets</code>\"><code>datasets</code><a href=\"javascript:jumpAnchor('<code>datasets</code>')\" class=\"mfe-blog-toc-item mfe-blog-toc-item-h4\">#</a></h4><p>Array of objects, each object defines a set of polyline-relevant attributes.</p>\n<pre><code class=\"lang-javascript\">{\n  color: <span class=\"hljs-string\">'#ff5858'</span>, // storke color, optional, <span class=\"hljs-keyword\">default</span> color <span class=\"hljs-keyword\">is</span> orange\n  theme: <span class=\"hljs-string\">'heat'</span>,    // theme, the <span class=\"hljs-keyword\">value</span> can be <span class=\"hljs-string\">'heat'</span> <span class=\"hljs-keyword\">or</span> <span class=\"hljs-string\">'region'</span>, <span class=\"hljs-keyword\">default</span> <span class=\"hljs-keyword\">value</span> <span class=\"hljs-keyword\">is</span> empty\n  width: <span class=\"hljs-number\">1</span>,         // width, optional, <span class=\"hljs-keyword\">default</span> <span class=\"hljs-keyword\">value</span> <span class=\"hljs-keyword\">is</span> <span class=\"hljs-number\">1</span>\n  <span class=\"hljs-keyword\">values</span>: [<span class=\"hljs-number\">15</span>, <span class=\"hljs-number\">20</span>]  // <span class=\"hljs-keyword\">array</span>\n}\n</code></pre>\n<h4 id=\"Override Style\">Override Style<a href=\"javascript:jumpAnchor('Override Style')\" class=\"mfe-blog-toc-item mfe-blog-toc-item-h4\">#</a></h4><p>The default chart style is shown as below</p>\n<pre><code class=\"lang-stylus\"><span class=\"hljs-keyword\">.md</span>-chart\n  line\n    stroke <span class=\"hljs-comment\">#ccc</span>\n    stroke-width 0.5\n    stroke-linecap square\n  path\n    stroke <span class=\"hljs-comment\">#fa8919</span>\n    stroke-width 1\n    stroke-linecap butt\n<span class=\"hljs-keyword\">  .md</span>-chart-axis-y\n    text\n     <span class=\"hljs-built_in\"> fill </span><span class=\"hljs-comment\">#666</span>\n      font-size 0.2rem\n      text-anchor end\n<span class=\"hljs-keyword\">  .md</span>-chart-axis-x\n    text\n     <span class=\"hljs-built_in\"> fill </span><span class=\"hljs-comment\">#666</span>\n      font-size 0.22rem\n      text-anchor middle\n</code></pre>\n",s=t.toc="<a href=\"javascript:jumpAnchor('Import')\" class=\"mfe-blog-toc-item mfe-blog-toc-item-h3\">Import</a><a href=\"javascript:jumpAnchor('Code Examples')\" class=\"mfe-blog-toc-item mfe-blog-toc-item-h3\">Code Examples</a><a href=\"javascript:jumpAnchor('API')\" class=\"mfe-blog-toc-item mfe-blog-toc-item-h3\">API</a><a href=\"javascript:jumpAnchor('Chart Props')\" class=\"mfe-blog-toc-item mfe-blog-toc-item-h4\">Chart Props</a><a href=\"javascript:jumpAnchor('<code>datasets</code>')\" class=\"mfe-blog-toc-item mfe-blog-toc-item-h4\"><code>datasets</code></a><a href=\"javascript:jumpAnchor('Override Style')\" class=\"mfe-blog-toc-item mfe-blog-toc-item-h4\">Override Style</a>"},zOcZ:function(e,t,a){var o=a("9/TQ");"string"==typeof o&&(o=[[e.i,o,""]]),o.locals&&(e.exports=o.locals);a("rjj0")("19935540",o,!0,{})}});